<script>
export default {
  data() {
    return {
      guanValue: false,
      queryObj: this.$route.query,
      masterDetail: {
        name: "",
        serve_name: "",
        num_all: 0,
        virtual_rate: 0,
        peer_accept: 0,
        gre_tag: []
      },
      PageId: 0,
      orderServer: [],
      commentPageId: 0,
      commentCount: 0,
      commentList: [],
      server: 2,
      relPrice: 0,
      lookHide: true,
      servertitle: ""
    };
  },
  computed: {
    uid() {
      return this.$store.state.useMessage.mem_id || 0;
    }
  },
  methods: {
    reHome() {
      this.$router.push({
        name: "home"
      });
    },
    rand(min, max) {
      return Math.floor(Math.random() * (max - min)) + min;
    },

    toggleServe(e) {
      this.server = e;
      if (this.server == 1) {
        this.relPrice = this.masterDetail.phone_price;
      } else {
        this.relPrice = this.masterDetail.price;
      }
    },

    toggleGuan() {
      this.guanValue = !this.guanValue;
      if (this.guanValue) {
        this.$http
          .post("add_attention", {
            mem_id: this.uid,
            type: 1,
            resource_id: this.masterDetail.gre_id,
            token: this.$store.state.useMessage.token
          })
          .then(res => {});
      } else {
        this.$http
          .post("cancel_attention", {
            mem_id: this.uid,
            type: 1,
            resource_id: this.masterDetail.gre_id,
            token: this.$store.state.useMessage.token
          })
          .then(res => {});
      }
    },

    getMasterDetail(gre_id, cate_id, mem_id) {
      this.$http
        .post("great_detail", {
          gre_id: gre_id,
          cate_id: cate_id,
          mem_id: mem_id
        })
        .then(res => {
          this.masterDetail = res.data.data;
          this.relPrice = this.masterDetail.price;
          if (this.masterDetail.is_attention == 1) {
            this.guanValue = true;
          } else {
            this.guanValue = false;
          }
          document.title = this.masterDetail.name + "老师";
        });
    },

    getOrderServer(serve_id, gre_id, PageId) {
      this.$http
        .post("great_detail_serve", {
          serve_id: serve_id,
          gre_id: gre_id,
          PageId: PageId
        })
        .then(res => {
          if (res.data.data !== []) {
            res.data.data.forEach(element => {
              this.orderServer.push(element);
            });
          } else {
            this.lookHide = false;
          }
        });
    },

    getMoreOrther() {
      this.PageId++;
      this.getOrderServer(
        this.queryObj.cate_id,
        this.queryObj.gre_id,
        this.PageId
      );
    },

    doToggle(i) {
      this.getMasterDetail(this.queryObj.gre_id, i, this.uid);
      var timer = null;
      timer = setInterval(function() {
        var scrollTop =
          document.documentElement.scrollTop || document.body.scrollTop;

        var speed = Math.floor(-scrollTop / 6);
        document.documentElement.scrollTop = document.body.scrollTop =
          scrollTop + speed;

        if (scrollTop < 10) {
          clearInterval(timer);
        }
      }, 50);
    },

    getComment(gre_id, PageId) {
      this.$http
        .post("great_detail_discuss", { gre_id: gre_id, PageId: PageId })
        .then(res => {
          if (res.data.data !== []) {
            this.commentCount = res.data.data.num_all["0"].num;
            var arr = res.data.data.comment;
            if (arr.length !== 0) {
              arr.forEach(element => {
                this.commentList.push(element);
              });
            } else {
            }
          }
        });
    },

    getMoreComment() {
      this.commentPageId++;
      this.getComment(this.queryObj.gre_id, this.commentPageId);
    },

    reSureOrder() {
      if (this.server == 1) {
        this.server = "预约电话";
      } else {
        this.server = "即时文字";
      }
      var searchMasterOrder = {
        price: this.relPrice,
        serverType: this.server,
        gre_id: this.queryObj.gre_id,
        classifyId: this.queryObj.cate_id,
        name: this.queryObj.name,
        gre_name: this.masterDetail.name,
        type: "找大师",
        serve_id: this.masterDetail.serve_id
      };
      localStorage.setItem("orderMessage", JSON.stringify(searchMasterOrder));
      this.$router.push({ name: "sureOrder" });
    }
  },
  created() {
    this.getMasterDetail(this.queryObj.gre_id, this.queryObj.cate_id, this.uid);
    this.getOrderServer(
      this.queryObj.cate_id,
      this.queryObj.gre_id,
      this.PageId
    );
    this.getComment(this.queryObj.gre_id, this.commentPageId);

    this.si = this.rand(600, 1000);
    console.log(this.si);
    this.san = this.rand(200, 600);
    this.er = this.rand(10, 20);
    this.yi = this.rand(0, 10);
  },
  mounted() {
    document.getElementById("one").style.width =
      (this.si / (this.si + this.san + this.er + this.yi)) * 100 + "%";

    document.getElementById("two").style.width =
      (this.san / (this.si + this.san + this.er + this.yi)) * 100 + "%";
    document.getElementById("three").style.width =
      (this.er / (this.si + this.san + this.er + this.yi)) * 100 + "%";
    document.getElementById("four").style.width =
      (this.yi / (this.si + this.san + this.er + this.yi)) * 100 + "%";
    this.one = document.getElementById("one").offsetWidth;
  }
};
</script>